(function(){let a=document.getElementsByClassName("nav-item");for(let b of a)b.addEventListener("click",activeTab)})();function activeTab(a){a.preventDefault(),a.target.classList.add("active");const c=a.target.getAttribute("href").replace("#","");getSiblings(a.target).forEach(a=>{a.classList.remove("active")});const b=document.getElementById(c);getSiblings(b).forEach(a=>{a.classList.remove("active")}),b.classList.add("active")}function getSiblings(b){let c=[];if(!b.parentNode)return c;let a=b.parentNode.firstChild;while(a)a.nodeType===1&&a!==b&&c.push(a),a=a.nextSibling;return c}